import React from "react";
import { Flex } from "rebass";
import { theme } from "../theme";

const Container = (children) => {
  return (
    <Flex
      height="100vh"
      flexDirection="column"
      bg={theme.colors.jet}
      margin={0}
      paddingBottom={44}
      overflowX="hidden"
      overflowY="scroll"
      width="100%"
    >
      {children}
    </Flex>
  );
};

export default Container;
